script: |
  super -f text -I q1965.spq | sort > q1965.out

inputs:
  - name: q1965.spq
    data: |
      SELECT DISTINCT 7 AS col0 FROM tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet), tab1 (FORMAT parquet) AS cor1, tab0 (FORMAT parquet) AS cor2;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q1965.out
    data: |
      7
